import React, { Component } from "react";
import "./About.css";

class About extends Component {
  constructor(props) {
    super(props);

    this.state = {
      name: "",
      description: ""
    };
  }

  render() {
    return (
      <form>
        <div>
          <textarea
            input="text"
            placeholder="Enter the category name.. "
            className="textarea1"
          />
        </div>
        <div>
          <textarea
            input="text"
            placeholder="Enter the category description.."
            className="textarea2"
          />
        </div>
        <div>
          <button className="button">Create</button>
        </div>
      </form>
    );
  }
}

export default About;
